import React, { Component } from 'react'
import ReactApexChart from 'react-apexcharts'


class Charts extends Component {
    
  state = {
    series: [],
    options: {
      chart: {
        id: 'realtime',
        height: 350,
        type: 'line',
        animations: {
          enabled: true,
          easing: 'linear',
          dynamicAnimation: {
            speed: 1000
          }
        },
        toolbar: {
          show: false
        },
        zoom: {
          enabled: false
        }
      },
      dataLabels: {
        enabled: false
      },
      stroke: {
        curve: 'smooth'
      },
      title: {
        text: 'Viewer count of Dota 2, Rocket League and HearthStone',
        align: 'left'
      },
      markers: {
        size: 0
      },
      xaxis: {
        type: 'numeric',
        categories: Date.now(),
        range: 10,
        labels: {
          show: true, 
          datetimeUTC: true,
          datetimeFormatter: {
              year: 'yyyy',
              month: "MMM 'yy",
              day: 'dd MMM',
              hour: 'HH:mm',
          },
        }
      },
      yaxis: {
        // max: 100
      },
      legend: {
        show: false
      },
    }, 
  };
    
  render() {
      return (
          <div id="chart">  
              <ReactApexChart style={{width: "80%"}} options={this.state.options} series={this.props.series} type="line" height={350} />
          </div>
      )
  }
}
 
export default Charts
